import React from "react";
// import { NavLink } from "react-router-dom";
import { NavHashLink as NavLink } from "react-router-hash-link";
// import CommonParent from "./CommonParent";
//import web from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/Katie-Author-Bio-Pic.png";
const About = () => {
  return (
    <section id="app" className="app">
      <div className="#about pb-3 mt-5" id="about">
        <h1 className="text-center">About Me</h1>
      </div>

      <section>
        <div className="container-fluid">
          <div className="row">
            <div className="col-10 mx-auto">
              <p className="text-center">
                Hi! I am Maah. Currently, I am in my fourth-year, pursuing
                computer science degree at Western University.
                <br /> I am also working as a Quality-Assurance Engineer Intern
                at Royal Bank of Canada (RBC) located in <br />
                Mississauga, Ontario.
                <br />
                <br />
                Recently, I discovered my passion for illustration. Thus, I
                decided to self-taught myself digital illustration from scratch,
                and bring creative ideas to live. When I am not coding, or
                pushing pixels, you'll find me hanging out with friends, working
                out, or binge-watching on Netflix.
                <br />
                <br />
                <br />
              </p>

              <div className="d-flex justify-content-center pt-4">
                <NavLink smooth to="/#resume" className="btn-get-started">
                  View Resume
                </NavLink>

                <NavLink smooth to="/#contact" className="btn-get-started">
                  Contact Me
                </NavLink>
              </div>
            </div>
          </div>
        </div>
      </section>
    </section>
  );
};

export default About;
